INSERT INTO `v1_8df7f19d210b49ce07464b26b0faa825d1e7dadce18c1c8ae70d16871ec070c8` VALUES ("---", 1, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 2, "アサヒ", "", 6000, 1, 3, 0);
INSERT INTO `v1_8df7f19d210b49ce07464b26b0faa825d1e7dadce18c1c8ae70d16871ec070c8` VALUES ("アドレナリン", 1, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 3, "部員3", "ホームランを連発すると、連発数に応じてパワーアップする", 16000, 3, 0, 3);
INSERT INTO `v1_8df7f19d210b49ce07464b26b0faa825d1e7dadce18c1c8ae70d16871ec070c8` VALUES ("ラッキー", 1, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 4, "{0}", "幸運のハプニングを呼び込む", 30000, 2, 2, 2);
INSERT INTO `v1_8df7f19d210b49ce07464b26b0faa825d1e7dadce18c1c8ae70d16871ec070c8` VALUES ("", 0, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", 5, "選手名鑑 おまけページ", "", 50000, 0, 1, 1);
